import React , { Component } from 'react';

import Aux from '../../hoc/aux';
import Burger from '../../components/burger/burger';

class Builder extends Component {
    render() {
        return (
            <Aux>
                <Burger/>
                <div>Burger Controls</div>
            </Aux>
        );
    }
}

export default Builder;
